Bom dia Patriotas 
É muito frustrante e triste ter que acompanhar os episódios que se desenrolam esta semana no nosso país...
* Traficantes atirando em comunidade pra mostrar insatisfação com a presença de pessoas que não são alinhadas com eles;
* Censura explícita a meios de comunicação, youtubers, influenciadores, comentaristas e jornalistas que não sejam alinhados com a esquerda; 
* Depreciação da filha do nosso Presidente de apenas 12 anos;
* Invasão de igreja em Joinville...
Ainda estamos na quarta feira. O que mais podemos esperar?
Após o dia 30, com a nossa Vitória, precisamos fazer uma boa faxina pra moralizar algumas instituições.
Peço que Mantenham a Esperança e o engajamento. A nossa campanha está excelente e o povo brasileiro está reconhecendo isso.

Aqui na Baixada, #somostodostarcisioebolsonaro. 🇧🇷😎🙏🏼

